import React from 'react';
import { Api } from '../../services/api';
import { Text, View, Image, TouchableOpacity, ImageBackground } from 'react-native';
import s from './style';
import { Feather } from '@expo/vector-icons';
import * as ImagePicker from 'expo-image-picker';
import UserPermissions from '../../services/UserPermissions'
import * as Auth from '../../services/auth';


const userId = Auth.GetUserId();
export default class Perfil extends React.Component {

  state = {
    user: {
      avatar: null
    },
    errorMessage: null,
  };

  logOut = async () => {
    await Auth.signOutAsync();
    this.props.navigation.navigate('Login');;
  };

  componentDidMount(){
    var user = Auth.GetUserId();
    console.log("entrei aqui", user)

    new Api("Usuario").get({AttributeBehavior: "GetInfoUsuarioPerfil", UsuarioId: userId}).then(data => {
      // console.log("datausuario", data)
      var dataList = data.dataList;

      this.setState({
        user: {avatar: dataList.foto}
      })
    })
  }

  handlePickAvatar = async () => {
    UserPermissions.getCameraPermission();

    let result = await ImagePicker.launchImageLibraryAsync({
      mediaTypes: ImagePicker.MediaTypeOptions.Images,
      allowsEditing: true,
      aspect: [4, 3]
    })
    if (!result.cancelled) {
      this.setState({ user: { ...this.state.user, avatar: result.uri } })
      new Api("Usuario").post({foto: this.state.user.avatar, UsuarioId: this.userId}).then(data => { this.componentDidMount()})

      console.log("avatar", this.state.user)
    }
  };

  render() {
    return (
      <View style={s.container}>
        <Image source={require('../../assets/avatar.png')} blurRadius={1} style={s.imgBackground}></Image>
        <TouchableOpacity style={s.btnEditPerfil} onPress={() => { this.props.navigation.navigate('PersonalInformation') }}>
          <Feather name='settings' size={22} color='#2AB940'></Feather>
        </TouchableOpacity>
        <TouchableOpacity style={s.btnNotificacao} onPress={() => { this.props.navigation.navigate('Notificacao') }}>
          <View style={s.NotificationCount}></View>
          <Feather name='bell' size={22} color='#2AB940'></Feather>
        </TouchableOpacity>
        <TouchableOpacity style={s.btnOds} onPress={() => { this.props.navigation.navigate('Ods') }}>
          <Feather name='award' size={22} color='#2AB940'></Feather>
        </TouchableOpacity>
        <TouchableOpacity style={s.btnLogout} onPress={this.logOut}>
          <Feather name='log-out' size={22} color='white'></Feather>
        </TouchableOpacity>

        <View >
          <ImageBackground style={s.circleImg} source={require('../../assets/avatar.png')}>
            <Image style={s.circleImg} source={{ uri: this.state.user.avatar }} />
          </ImageBackground>
          <TouchableOpacity style={s.btnTrocarImg} onPress={this.handlePickAvatar}>
            <Feather name='camera' size={16} color='#2AB940'></Feather>
          </TouchableOpacity>
        </View>
        <Text style={s.userName}> Jo√£o de Narnia </Text>
        <Text style={s.userSubTitulo}> joaozin_narnia_2020@gmail.com </Text>
      </View>
    );
  }
}
